PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE "schema_migrations" ("version" varchar NOT NULL);
CREATE TABLE "users" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "name" varchar, "username" varchar, "password_digest" varchar, "picture_url" varchar, "created_at" datetime, "updated_at" datetime);
CREATE TABLE "games" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "title" varchar, "shortname" varchar, "picture_url" varchar, "created_at" datetime, "updated_at" datetime);
CREATE TABLE "matches" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "game_id" integer, "player1_id" integer, "player2_id" integer, "winner_id" integer, "loser_id" integer, "created_at" datetime, "updated_at" datetime);
CREATE TABLE "reset_requests" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "requester_id" integer, "requested_id" integer, "game_id" integer, "confirmed" boolean DEFAULT 'f', "created_at" datetime, "updated_at" datetime, "rejected" boolean DEFAULT 'f');
DELETE FROM sqlite_sequence;
CREATE UNIQUE INDEX "unique_schema_migrations" ON "schema_migrations" ("version");
COMMIT;
